script: |
  super -f text -I q160.spq | sort > q160.out

inputs:
  - name: q160.spq
    data: |
      SELECT DISTINCT + - cor0.col0 / col1 + col2 + - col2 * + ( col1 ) AS col0 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q160.out
    data: |
      -2805
      -7380
      -96
